import React from 'react';
import Styled from 'styled-components';

const Menu = Styled.ul`
color: red;
`

const Header = () => {
	return (
		<Menu>
			<li>Home</li>
			<li>About</li>
			<li>Profile</li>
		</Menu>
		)
}

export default Header
